import tkinter as tk

IMAGE_DATA = ''''''
x = 0
y = 0
dx = 0
dy = 0

def move(event):
  global x
  global y

  dx = event.x - x
  dy = event.y - y
  x = event.x
  y = event.y
  canvas.move(canvas_item, -dx, -dy)
 
if __name__ == "__main__":
  root = tk.Tk()
  root.title("CONNECT THE PYTHONISTAS")
  _image = tk.PhotoImage(data=IMAGE_DATA)
  _width = _image.width()
  _height = _image.height()
  canvas = tk.Canvas(width = _width/2.0, height = _height/2.0)
  canvas.pack(expand = 1, fill = tk.BOTH)
  x = (_width) / 4.0
  y = (_height) / 4.0
  canvas_item = canvas.create_image(x, y, image = _image)
  root.bind('<Motion>', move)
  root.mainloop()

